import re

def identify_snake_type(snake_string: str) -> str:
    """"""
    SNAKE_A = re.compile(">'(=+)#\\1~")
    SNAKE_B = re.compile('>\\^(Q=)+~~')
    if SNAKE_A.fullmatch(snake_string):
        return 'A'
    elif SNAKE_B.fullmatch(snake_string):
        return 'B'
    else:
        return 'NA'
